/**
 * Interface `CarouselConfig` to change the style of the carousel and some additional features.
 */
export interface CarouselConfig {
    maxWidth: string;
    maxHeight: string;
    showArrows: boolean;
    objectFit: string;
    keyboardEnable: boolean;
    modalGalleryEnable: boolean;
    legacyIE11Mode: boolean;
}
